                "headline": "Special Weather Statement issued September 12 at 9:42PM EDT by NWS Columbia SC",
                "description": "At 941 PM EDT, Doppler radar was tracking a strong thunderstorm over\nSumter, moving southeast at 20 mph.\n\nHAZARD...Wind gusts of 50 to 55 mph. Heavy rainfall that will lead\nto ponding of water on roadways and minor flooding of low\nlying areas.\n\nSOURCE...Radar indicated.\n\nIMPACT...Gusty winds could knock down tree limbs and blow around\nunsecured objects.\n\nLocations impacted include...\nSumter, South Sumter, Mulberry, Alcolu, Sumter County Airport,\nMillwood, Turbeville, Cane Savannah, Brogdon, Lakewood, Privateer,\nEast Sumter, Gable, Oswego, Wedgewood, and Shiloh.\n\nThis includes Interstate 95 between mile markers 121 and 137.",
                "instruction": "If outdoors, consider seeking shelter inside a building.\n\nTorrential rainfall is also occurring with this storm and may lead to\nlocalized flooding. Do not drive your vehicle through flooded\nroadways.\n\nFrequent cloud to ground lightning is occurring with this storm.\nLightning can strike 10 miles away from a thunderstorm. Seek a safe\nshelter inside a building or vehicle.",
