                "headline": "Flood Watch issued September 12 at 5:32PM AKDT until September 15 at 12:00PM AKDT by NWS Juneau AK",
                "description": "* WHAT...Flooding caused by excessive rainfall continues to be\npossible.\n\n* WHERE...The following areas, Central Inner Channels and Eastern\nGulf Coast. This includes the cities of Sitka, Juneau, And\nPetersburg.\n\n* WHEN...From Thursday morning through Friday morning.\n\n* IMPACTS...Excessive runoff may result in flooding of rivers,\ncreeks, streams, other low-lying areas and flood-prone locations.\n\n* ADDITIONAL DETAILS...\n- Heavy rainfall in the range of 2 to 4 inches is expected\nacross Southeast Alaska Wednesday night into Friday.\n\n\n- Stay away from steep barren hillsides due to the landslide\ndanger.\n- All residents on or near mountain slopes should be prepared for\npossible landslides.",
