                "headline": "Marine Weather Statement issued September 12 at 9:29PM EDT by NWS Baltimore MD/Washington DC",
                "description": "The areas affected include...\nChesapeake Bay from Drum Point MD to Smith Point VA...\nChesapeake Bay from North Beach to Drum Point MD...\nChoptank River to Cambridge MD and the Little Choptank River...\nPatuxent River to Broomes Island MD...\nTangier Sound and the inland waters surrounding Bloodsworth\nIsland...\nTidal Potomac from Cobb Island MD to Smith Point VA...\nTidal Potomac from Indian Head to Cobb Island MD...\n\nAt 929 PM EDT, Doppler radar indicated a line of showers, capable of\nproducing winds to around 30 knots. This shower was located 26 nm\nsouth of Fairview Beach, moving northeast at 30 knots.",
                "instruction": "Mariners can expect gusty winds to around 30 knots, locally higher\nwaves, and lightning strikes. Boaters should seek safe harbor\nimmediately until this storm passes.\n\nThis a shower will likely produce winds to around 30 knots, and could\npose a serious hazard for boaters. A special marine warning may\neventually be required when this storm reaches the nearshore waters.\nBoaters should consider heading for shore before the storm arrives.",
