                "senderName": "NWS Flagstaff AZ",
                "headline": "Flash Flood Warning issued September 12 at 6:07PM MST until September 12 at 9:15PM MST by NWS Flagstaff AZ",
                "description": "The National Weather Service in Flagstaff has issued a\n\n* Flash Flood Warning for...\nThe Slate Creek basin in...\nGila County in east central Arizona...\n\n* Until 915 PM MST.\n\n* At 606 PM MST, Doppler radar and automated rain gauges indicated\nthunderstorms producing heavy rain over the Slate Creek and\nCottonwood Creek basins. Between 1 and 2 inches of rain have\nfallen. Additional rainfall amounts up to 1 inch are possible in\nthe warned area. Flash flooding is ongoing or expected to begin\nshortly.\n\nHAZARD...Life-threatening flash flooding. Thunderstorms\nproducing flash flooding in and around the Slate Creek\nbasin.\n\nSOURCE...Radar and automated gauges.\n\nIMPACT...Life threatening flash flooding of areas in and around\nthe Slate Creek basin.\n\n* Some locations that will experience flash flooding include...\nOak Spring Canyon.\n\nThis includes the following highways...\nState Route 188 between mile markers 267 and 272.\nState Route 87 between mile markers 230 and 233.",
                "instruction": "Get to higher ground immediately! Raging flash flood waters and\ndebris will inundate residences near State Route 188 along the banks\nof Slate Creek.\n\nTurn Around, Don't Drown! National Forest Service Road 26 and low\nwater crossings through Slate Creek will be washed out and\nimpassable. Flood waters may overtop State Route 188 as culverts\nbecome clogged from flood debris.\n\nIn hilly or mountainous terrain, there are many low water crossings\nwhich will become dangerous in heavy rain. Do not attempt to cross\nflooded roads. Find an alternate route.",
