                "senderName": "NWS Newport/Morehead City NC",
                "headline": "High Surf Advisory issued September 12 at 8:34PM EDT until September 16 at 8:00PM EDT by NWS Newport/Morehead City NC",
                "description": "* WHAT...For the High Surf Advisory, large breaking waves of 8 to\n12 feet in the surf zone. For the Beach Hazards Statement,\ndangerous rip currents and large breaking waves expected in the\nsurf zone.\n\n* WHERE...Hatteras Island beaches.\n\n* WHEN...For the High Surf Advisory, until 8 PM EDT Saturday.\nFor the Beach Hazards Statement, from 8 AM EDT Wednesday\nthrough Wednesday evening.\n\n* IMPACTS...Dangerous swimming and surfing conditions and\nlocalized beach erosion. Rip currents can sweep even the best\nswimmers away from shore into deeper water. Dangerous shore\nbreak can throw a swimmer or surfer head first into the bottom\ncausing neck and back injuries.\n\n* ADDITIONAL DETAILS...The most likely time for strong rip\ncurrents to occur is a couple hours either side of low tide,\nwhich will occur around 1:15 PM Wednesday.",
                "instruction": "Inexperienced swimmers should remain out of the water due to\ndangerous surf conditions.\n\nLife-threatening rip currents. If caught in a rip current, remain\ncalm. Swim in a direction following the shoreline. If tired,\nfloat or tread water until out of the rip current. If unable to\nescape, face the shore and call or wave for help.\n\nShore break occurs when waves break directly on the beach. It is\nextremely important to protect your head and neck whenever you\nare in breaking waves by keeping your hands in front of you at\nall times.",
