                "senderName": "NWS Upton NY",
                "headline": "High Surf Advisory issued September 12 at 7:39PM EDT until September 14 at 10:00PM EDT by NWS Upton NY",
                "description": "* WHAT...For the High Surf Advisory, large breaking waves of 5 to\n8 feet expected in the surf zone on Wednesday and 7 to 10 feet\non Thursday. For the High Rip Current Risk, dangerous rip\ncurrents expected.\n\n* WHERE...The ocean beaches of Suffolk and Nassau Counties.\n\n* WHEN...For the High Surf Advisory, from 6 AM Wednesday to 10\nPM EDT Thursday. For the High Rip Current Risk, from 6 AM EDT\nWednesday through Friday evening.\n\n* IMPACTS...Dangerous swimming and surfing conditions and\nlocalized beach erosion. Life-threatening rip currents are\nlikely for all people entering the surf zone. Anyone visiting\nthe beaches should stay out of the surf. Rip currents can\nsweep even the best swimmers away from shore into deeper water.\n\n* ADDITIONAL DETAILS...Based on the National Hurricane Center\nforecast track and intensity of Hurricane Lee, these hazards\nwill likely persist into at least Saturday",
                "instruction": "Inexperienced swimmers should remain out of the water due to\ndangerous surf conditions.\n\nIf you enter the surf zone, always have a flotation device with\nyou and swim near a lifeguard. If caught in a rip current, relax\nand float, and do not swim against the current. If able, swim in\na direction following the shoreline. If unable to escape, face\nthe shore and yell or wave for help.",
