                "senderName": "NWS Juneau AK",
                "headline": "Marine Weather Statement issued September 12 at 1:05PM AKDT by NWS Juneau AK",
                "description": "A pair of strong fronts will be bringing an extended period of\nhigher winds and seas for the inner channels starting Wed night.\nThe first front will be arriving Wed night with 25 to 30 kt winds\nexpected for many areas of the inner channels. These winds will\ncontinue through early Fri morning. Seas will also be high with\nupwards of 5 to 7 ft seas likely.\n\nFollowing this first front will be a brief break on Fri before the\nnext front comes inland for Fri night into Sat night. This front\nhas the potential to be a little stronger with widespread 25 to\n35 kt wind likely. Seas will also be around 5 to 7 ft for most of\nthat period. We will continue to update the forecast as we get\ncloser to the event.",
