                "description": "* WHAT...North winds 20 to 25 kt with gusts up to 30 kt and steep\nwind-driven seas of 6 to 9 ft Wednesday. North winds increase to\n25 to 30 kt with gusts up to 40 kt and wind-driven seas becoming\nvery steep 8 to 11 feet Wednesday evening.\n\n* WHERE...Small Craft Advisory conditions are expected for all\nareas, with very steep and hazardous seas developing south of\nGold Beach.\n\n* WHEN...The Small Craft Advisory is in effect from 5 AM\nWednesday to 8 PM PDT Thursday, with a Hazardous Seas Warning\nin effect from 5 PM Wednesday to 8 PM PDT Thursday.\n\n* IMPACTS...Gusty winds and very steep and hazardous seas could\ncapsize or damage vessels.\n\n* ADDITIONAL DETAILS...Isolated gale force gusts will be possible\nWednesday evening beyond 10 nm south of Gold Beach.\n\n* View the hazard area in detail at https://go.usa.gov/x6hks",
                "instruction": "Recreational boaters should remain in port. Commercial vessels\nshould prepare for very steep seas and consider remaining in port\nuntil conditions improve.",
