                "senderName": "NWS Upton NY",
                "headline": "Flood Watch issued September 12 at 3:46PM EDT until September 13 at 6:00PM EDT by NWS Upton NY",
                "description": "* WHAT...Flooding caused by excessive rainfall is possible.\n\n* WHERE...Portions of southern Connecticut, including the following\nareas, Northern Fairfield and Southern Fairfield. Portions of\nnortheast New Jersey, including the following areas, Eastern\nBergen, Eastern Essex, Eastern Passaic, Eastern Union, Hudson,\nWestern Bergen, Western Essex, Western Passaic and Western Union.\nPortions of southeast New York, including the following areas,\nBronx, Kings (Brooklyn), New York (Manhattan), Northern Nassau,\nNorthern Queens, Northern Westchester, Orange, Putnam, Richmond\n(Staten Island), Rockland, Southern Nassau, Southern Queens and\nSouthern Westchester.\n\n* WHEN...From late tonight through Wednesday afternoon.\n\n* IMPACTS...Excessive runoff may result in flooding of rivers,\ncreeks, streams, and other low-lying and flood-prone locations.\nFlooding may occur in poor drainage and urban areas. Storm drains\nand ditches may become clogged with debris.\n\n* ADDITIONAL DETAILS...\n- Showers and thunderstorms will produce heavy rainfall which\ncould result in rainfall rates up to 1 to 2 inches per hour\nat times. Areas receiving multiple rounds of showers and\nthunderstorms with heavy rain have a chance for flash\nflooding in low lying, poor drainage and urban areas.\n- http://www.weather.gov/safety/flood",
                "instruction": "You should monitor later forecasts and be alert for possible Flood\nWarnings. Those living in areas prone to flooding should be prepared\nto take action should flooding develop.",
