                "description": "* WHAT...Flash flooding caused by excessive rainfall is possible.\n\n* WHERE...Portions of northwestern Connecticut, including the\nfollowing areas, Northern Litchfield and Southern Litchfield.\nPortions of east central New York, including the following areas,\nEastern Dutchess, Eastern Ulster, Western Dutchess and Western\nUlster.\n\n* WHEN...From Wednesday morning through Wednesday afternoon.\n\n* IMPACTS...Excessive runoff may result in flooding of rivers,\ncreeks, streams, and other low-lying and flood-prone locations.\nFlooding may occur in poor drainage and urban areas.\n\n* ADDITIONAL DETAILS...\n- Showers and isolated to scattered thunderstorms may produce\nheavy rainfall leading to isolated flash flooding Wednesday\nmorning into the afternoon.  Total rainfall amounts will\nrange from 1 to 3 inches.  Hourly rainfall rates may reach an\ninch an hour briefly.  Some flooding in urban and poor\ndrainage areas is possible.\n- http://www.weather.gov/safety/flood",
