                "senderName": "NWS Anchorage AK",
                "headline": "Flood Advisory issued September 12 at 10:23AM AKDT until September 14 at 10:15PM AKDT by NWS Anchorage AK",
                "description": "* WHAT...Flooding caused by a glacier-dammed lake outburst is\nexpected.\n\n* WHERE...Kenai River downstream of the bridge in Soldotna.\n\n* WHEN...Until 1015 PM AKDT Thursday.\n\n* IMPACTS...Minor flooding in low-lying and poor drainage areas.\n\nBig Eddy subdivision roads will have 0.5 to 1.0 feet of water over\ntop and most low lying areas in subdivision will be inundated.\n\nIsolated homes near the Beaver Creek outlet may see some water in\nlow lying parts of yards.\n\nPillars boat launch will be nearly underwater\n\n\n* ADDITIONAL DETAILS...\n- At 1015 AM AKDT, The Skilak Glacier Lake is releasing at this\ntime.\nThis, combined with higher than normal water levels from Fall\nseason rainfall will cause water levels on the Kenai River to\nrise to near or above minor flood levels on the Kenai River\nbelow the Soldotna Bridge (River mile 21).\nAnticipated High water levels will occur Wednesday September\n13th: Soldotna Bridge: 12.0 feet\n\n\n- For Kenai River at Soldotna:\nAt 9:00am the stage was 11.37 feet.\nFlood Stage is 12.0 feet.\nForecast: A crest around 12.0 feet is expected around 4:00pm\nWednesday.\n- Inherent uncertainty in initial glacier lake volume will\nresult in varying crest height and timing.\n- http://www.weather.gov/safety/flood",
                "instruction": "Turn around, don't drown when encountering flooded roads. Most flood\ndeaths occur in vehicles.",
