                "senderName": "NWS Anchorage AK",
                "headline": "Flood Warning issued September 12 at 9:56AM AKDT until September 17 at 12:00PM AKDT by NWS Anchorage AK",
                "description": "* WHAT...Flooding caused by a glacier-dammed lake outburst continues.\n\n* WHERE...Kenai River Below Skilak Lake, Including Kenai Keys.\n\n* WHEN...Until noon AKDT Sunday.\n\n* IMPACTS...Flooding of rivers, creeks, streams, and other low-lying\nand flood-prone locations is imminent or occurring.\n\n* ADDITIONAL DETAILS...\n- At 945 AM AKDT, river gauge reports indicate rises in water\nlevels from a glacier-dammed lake outburst across the warned\narea. River rises will cause flooding of small streams,\nespecially near the Kenai River.\n- Some locations that will experience flooding include...\n\n- For Kenai River below Skilak Lake:\nAt 8:30am the stage was 13.63 feet.\nFlood Stage is 13.0 feet.\nForecast: A crest around 15.2 feet is expected around 10:00am\nWednesday.\n\nImpacts:\nAt 15.0 feet: Water inundates the Kenai Keys neighborhood.\n\n- For Kenai River at Kenai Keys:\nAt 9:00am the stage was 11.58 feet.\nFlood Stage is 11.0 feet.\nForecast: A crest around 12.6 feet is expected around 10:00am\nWednesday.\n\nImpacts:\nAt 10.7 feet: In October of 2020, water was in the lowest\nlying garages of the Kenai Keys subdivision.\nAt 12.0 feet: Water starts to flow over some of the roads in\nthe Kenai Keys subdivision.\nAt 13.2 feet: In 2012, water was 2 feet deep over Kenai Keys\nRoad, near the entrance to the subdivison.\nAt 13.5 feet: Water starts to flow into garages and cabins in\nthe Kenai Keys subdivision; and likely flooding downstream.\n\n\n- Inherent uncertainty in initial glacier lake volume will\nresult in varying crest height and timing.\n- http://www.weather.gov/safety/flood",
                "instruction": "Turn around, don't drown when encountering flooded roads. Most flood\ndeaths occur in vehicles.",
                "response": "Avoid",
