                "headline": "Flood Warning issued September 12 at 6:36AM EDT until September 14 at 3:30AM EDT by NWS Boston/Norton MA",
                "description": "* WHAT...Minor flooding is forecast.\n\n* WHERE...Nashua River at East Pepperell.\n\n* WHEN...From this afternoon to early Thursday morning.\n\n* IMPACTS...At 9.0 feet, Minor lowland flooding is likely along the\nriver from East Pepperell downstream through Hollis. Flooding will\nimpact low lying businesses along Route 119 in Pepperell in the\nvicinity of its junction with Route 111.\n\n* ADDITIONAL DETAILS...\n- At 5:30 AM EDT Tuesday the stage was 6.3 feet.\n- Bankfull stage is 8.0 feet.\n- Forecast...The river is expected to rise above flood stage\nthis afternoon to a crest of 9.3 feet just after midnight\ntonight. It will then fall below flood stage late tomorrow\nevening.\n- Flood stage is 8.0 feet.\n- Flood History...This crest compares to a previous crest of\n9.4 feet on 05/16/2006.\n- http://www.weather.gov/safety/flood",
